import React, { Component } from 'react';
import { Jumbotron, Container, Col, Row } from 'react-bootstrap';


export class Portfolio extends Component {
      render() {
        return(
          <div>
          <Jumbotron>
          <h2>Portfolio Page</h2>
          </Jumbotron>
          <Container>
            <Row>
            <Col sm><i class=" fa-address-card">I</i></Col>
            <Col sm><i class="fas fa-database"></i></Col>
            <Col sm>three</Col>
            </Row>
          </Container>
          </div>
        )
      }
}
